var pat2rle=function(pat){
  var minx=pat[0][0];
  var maxx=minx;
  var miny=pat[0][1];
  var maxy=miny;
  for(var i=1;i<pat.length;i++){
    minx=Math.min(minx,pat[i][0]);
    maxx=Math.max(maxx,pat[i][0]);
    miny=Math.min(miny,pat[i][1]);
    maxy=Math.max(maxy,pat[i][1]);
  }
  var width=maxx-minx+1;
  var height=maxy-miny+1;
  var rle=[];
  for(var i=0;i<height;i++){
    rle.push([]);
    for(var j=0;j<width;j++){
      rle[i].push(".");
    }
  }
  //console.log(rle);
  for(var i=0;i<pat.length;i++){
    rle[pat[i][1]-miny][pat[i][0]-minx]="o";
  }
  for(var i=0;i<height;i++){
    //console.log(rle[i]);
    rle[i]=rle[i].join("");
  }
  rle=rle.join("\n");
  return rle;
}
